import './assets/jufb-bootstrap.css';
import { BrowserRouter as Router } from 'react-router-dom';
import { Routes } from './routes';
import { Main } from './components/Main';
import { Footer } from './components/Footer';

function App() {
  return (
    <div className="App">
      <Router>
        <Routes />
      </Router>

      <Main />

      <Footer />
    </div>
   );
}
export default App;
